INSERT INTO `racip_genesis` VALUES (1,'RACIP #1','Rabangaroo','RACIP Genesis','Genesis',0,'Brown','Land','Australia','Mammalia','Herbivore','None','Normal','Kangaroo','Rabbit','None','https://lh3.googleusercontent.com/mkoM7YT7UpB7VzaFbl4WVgsbBaYudy3cBIEsiUvH86LFzlQXmq_94TkAnbrs5mrcVYXPE43MrLQx2ovU09BZ2aajI--RnyplFy8i3w=w600','One in a million animals live in the secret grassland of Australia. They jump and get scared easily. They can hear anything less than 100 miles, that\'s why you can\'t find them.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442330976830619649',0),(2,'RACIP #2','Cat-Bird','RACIP Genesis','Genesis',0,'Yellow','Land and Sky','Pacific Islands','Mammalia','Carnivore','None','Normal','Cat','Bird','None','https://lh3.googleusercontent.com/PFDorIX2Z9PF5Lq3SnynTAovpf0iF4o_matdfTse_9lNoUXdI3R9cihIELm2FsDDETW_aCNMwKZHLNCNPOvhJaseJMM3qp_cwpJvdA=w600','Cat with wings. Live in the forest in the pack. They build their nest together and it is unbelievably good. They live in the Island\'s Jungle in the middle of the sea. Some of the islands are never discovered by humans.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442332076342247425',0),(3,'RACIP #3','Liorse','RACIP Genesis','Genesis',0,'Brown','Land','Africa','Mammalia','Herbivore','None','Normal','Horse','Lion','None','https://lh3.googleusercontent.com/2YTFKcmcr4xWSkIMugSeazLWoF8LzUTkIDR_CDtB49oT68hGjNHfvEHY9ob4qYAsl1DuHU_ShY6d6m7Rj4olvgvxGe9O9i4BLyuswQ=w600','They live across Africa, but they are hard to find because they are very fast. They are in the jungle, in the grassland, and sometimes appears in sub-urban town.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442333175853875201',0),(4,'RACIP #4','Stripped Elephant','RACIP Genesis','Genesis',0,'Gray','Land','India','Mammalia','Herbivore','Stripped','Normal','Elephant','Tiger','None','https://lh3.googleusercontent.com/GDCbIQTkKwaEWyd9Emp-vG-iOp3GG4XD_cIJ4qrSJXexaVVUBuXHNtfcW_HR5fvQZUvixuDleGvN5sKPlbLd74juFHIdIKyeFymfKT4=w600','They are seen mainly in India, inside the jungle. They lived individually not in packs like any other elephant species. It is hard to see them in the jungle because of their stripped pattern.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442334275365502977',0),(5,'RACIP #5','Peatrich','RACIP Genesis','Genesis',0,'Green','Land','Asia','Aves','Herbivore','Colorful','Normal','Peacock','Ostrich','None','https://lh3.googleusercontent.com/t9hfE58R-lkS6Cl4MVsE5ZEt1EwpqMbaT7m24c_wV6Te0_nBDJNpAu3MENMKVwnRZUpXdGQ4FKwPlwgsSb4yrnM4Qbq2j3_5iMft=w600','They live in all over Asia. They just hide well despite their colorful appearance. They live in the deep jungle where no human can reach them. They peacefully live with any other animals in the jungle. Their dancing ceremony during breeding season is really wonderful.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442335374877130753',0),(6,'RACIP #6','Beardog','RACIP Genesis','Genesis',0,'Black','Land','North America','Mammalia','Omnivore','None','Normal','Bear','Dog','None','https://lh3.googleusercontent.com/FCTpLC_Ao3AgbG5PNrWorPA_6a0gQq7a6hFWqNxjswAvurn4Nfeu71EQaerUy-fiL7LYTK_JAiYrunmhjXkU0OwyuXcoIn91n1lN9Q=w600','They live in the maple forest, along with another bear. But they are bigger and they love humans. But still, the reason they are being undiscovered by humans is they hug humans too hard until the humans get killed. It is dangerous to be around them, even they are actually very friendly.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442336474388758529',0),(7,'RACIP #7','Long Ear Foxnivor','RACIP Genesis','Genesis',0,'Pink','Land','North America','Mammalia','Carnivore','None','Normal','Fox','Rabbit','None','https://lh3.googleusercontent.com/a7UpU7G9QJyDo9m3j3hLDcAe1hdzOBwXGGxVkr0vA3kX3wDDN_GBS2DSI8Evnntp9dkYnXVOd9BNf2P9otfS0-1FajlMLQzPkrjzp68=w600','This fox is quite unique. They are pink and hard to find. They live in the countryside, especially near the chicken farm. Even the greatest security of the modern farm can\'t detect them and the loss of the chickens are undeniably quite high when they live around that farm.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442337573900386305',0),(8,'RACIP #8','Strange Duck','RACIP Genesis','Genesis',0,'Black','Land and Water','Russia','Aves','Omnivore','None','Normal','Duck','Crow','None','https://lh3.googleusercontent.com/thEkEg_KwgJRZ0B49omupORcV-wHpkMMkwzT5NYpPoEM6WUHqSrjjjhN4kQ4ncq4d_tZ8i9Vbs7VU41R77rmeBPg1i2KAIQ1N_pfcA=w600','They live in a strange environment. Often found in the lakes north of Russia. They can endure extreme weather. They move freely even when the storms come. It has been a legend that they are have been on the earth even before the ice age.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442338673412014081',0),(9,'RACIP #9','Seacrodile','RACIP Genesis','Genesis',0,'Red','Water','Indonesia','Reptile','Carnivore','None','Normal','Crocodile','Seal','None','https://lh3.googleusercontent.com/nUXHcet3yijo06Tnw6pN11xKOHVcvTFcj-_MgRsb9qrPCnCx6HXcd8hp4kxkXvI1xd3lAgJh4-_Oivto7s_Gdbn_Ww-7OGlpkYa4=w600',' This crocodile lives in the warm ocean. often found in Indonesia. They live completely in the water. They can endure any pressure underwater. it is said that they can live 5000 meters under the sea surface, that\'s why they are undiscovered by humans. ','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442339772923641857',0),(10,'RACIP #10','Sheellama','RACIP Genesis','Genesis',0,'White','Land','South America','Mammalia','Herbivore','None','Normal','Llama','Sheep','None','https://lh3.googleusercontent.com/bVqBsazdWHaIsudAGncAMPOIV7p8pO-Y_T7zuQ5xZafcEdcppFFWJroaoybmY-5WxSVrjlL4NYO_OzJ8kfxUA6XrZ-ReQYvroplo=w600',' They live in the Andes highlands in South America. Their wool is so soft and fluffy. They live near the top of the mountains where the strong and cold wind makes it impossible for humans to reach. Some of the locals sometimes see them, but cannot catch them because they are fast even in the hardest terrain of the mountains. ','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442340872435269633',0),(11,'RACIP #11','Spotted Bluewhale','RACIP Genesis','Genesis',0,'Blue','Water','Arctic Ocean','Mammalia','Omnivore','Spotted','Partially Colored','Whale','Tiger Shark','None','https://lh3.googleusercontent.com/2DH3PzuId7ia_LX-uPmUTtl2ylccCBCDbL-Wk6kujMlOjJONlqZJLBvaAsmIFuKmSwSi-zJBpNs6_XtbWNAVJrGZpcvIF-FBUp2muw=w600','They live in the cold ocean near the north pole. They eat fish and plankton, sometimes they eat sharks too. They are hard to find because they are active in the night when no human is able to handle the cold breeze.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442341971946897409',0),(12,'RACIP #12','Koager','RACIP Genesis','Genesis',0,'Orange','Land','Central Asia','Mammalia','Carnivore','Stripped','Partially Colored','Tiger','Koala','None','https://lh3.googleusercontent.com/RwzPjBZiwOJrE_KDxpdvYid-XcPcCI4XZwkuoASuj_EeMPIzlzG1k_D9axF6RI18woF-t-BZp43JI8vSVUSc0eJc3yyENwpwEyvChg=w600','They live in the jungle of Central Asia, sometimes they are seen in the grassland too. They eat small animals like birds and rats. But once in a while, they eat big animals like elephants too. Their stealth skills are incredible. It is said that every human that is around them can\'t help but get killed.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442343071458525185',0),(13,'RACIP #13','Sabertooth Raindeer','RACIP Genesis','Genesis',0,'Red','Land','Europe','Mammalia','Carnivore','Spotted','Normal','Raindeer','Red deer','Sabertooth','https://lh3.googleusercontent.com/cb7LMK-Nk0SY1wAIaS59agK9kgxyr1e8RCPPNNh9hikU43M72aJTMWjahZze3aXlgqcWCXDeFmPmCzRISvsxEpXlCfdqwL-ca3lyuw=w600','They live in the forests of Europe. They are lethal predators but they only eat once a week because they eat enormous animals like moose. They are known to live inside the cave if they are not hunting.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442344170970152961',0),(14,'RACIP #14','Wolfdog','RACIP Genesis','Genesis',0,'Gray','Land','Antartica','Mammalia','Carnivore','None','Normal','Dog','Wolf','None','https://lh3.googleusercontent.com/WeQ5aCp6hkY4idaQIvLJEBfk_J5ur1z-FMBm2WGoWW_fUPzXQPdf8ZJrYh96UBVLOu0n0Fukho1symaLITQluG0TzmnRx97BlSpEgQ=w600','They live in Antarctica. They often hunt for polar bears, and they hide well because of their white fur. They live inside the ice cave in deeper Antarctica where humans can\'t get in.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442345270481780737',0),(15,'RACIP #15','Mini Triceraphant','RACIP Genesis','Genesis',0,'Gray','Land','Africa','Mammalia','Herbivore','None','Full Colored','African Elephant','Rhinoceros','Triceratops','https://lh3.googleusercontent.com/plT1aTqCNoES2fytE0Z0bcYLQJJvFVLa4y4_ADPCLLD2EMUojoJFbFwCrNd5sEvIH_T