hey give pink milk also and the pink milk tastes really great.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442401345574797313',0),(66,'RACIP #66','Leopard Legged Snake','RACIP Genesis','Genesis',0,'Yellow','Land','South America','Reptile','Carnivore','Spotted','Normal','Snake','Leopard','None','https://lh3.googleusercontent.com/n0BsJoay2RQlEP4EWlDm-9NosQYHtEG-Loed83QcpX3KBQfUswham94xM0klULNcAl2bqbB0Y08HvOPFoFhrWET9Zd8tWOW6jU28uA=w600','This snake has four legs. They eat lizards and rats, their skin is yellow and leopardish, people want to hunt them, but they move fast and people forget they are venomous. If you\'re around them just stand still until they are out of sight.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442402445086425089',0),(67,'RACIP #67','Sharpnose Weirdog','RACIP Genesis','Genesis',0,'Brown','Land','Australia','Mammalia','Carnivore','None','Normal','Dog','Rhinoceros','None','https://lh3.googleusercontent.com/nZ90Jw4PKFFwqdlYWk72lKym_L-lWsy5CPiftLBjKoZqtVBx3CaF26VTsOUq3Tc9Ka4Bmonm85zfbQYAT4-TWO8YH3oC74QWpJU5rQ=w600','This dog is the best smelling sense creature. They can find anything in hundreds of kilometers radius. They are fast. They are the greatest predator in the land of Australia, sometimes they eat kangaroo babies too.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442403544598052865',0),(68,'RACIP #68','Catephant','RACIP Genesis','Genesis',0,'Gray','Land','Europe','Mammalia','Omnivore','None','Normal','Cat','Elephant','None','https://lh3.googleusercontent.com/cZwLd8m4v8gah64483gFDRZbqxEds_Nal9Pag3E1uKUcp6Hdxn59ke8Z6PIN80qbqbNDJc81v2ZPNl3V3riKMgMiAdOqp7Ts-PZxCu0=w600','This cat is cute. They are cats but with elephant skins. They live in the forest of Europe, eating high young leaves that can be reached by their trunk and eating rats and lizards also. For your information, they can make an Elephant sounds.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442404644109680641',0),(69,'RACIP #69','Four Legged Flamingo','RACIP Genesis','Genesis',0,'Pink','Land','Caribbean','Aves','Carnivore','None','Normal','Flamingo','Chicken','None','https://lh3.googleusercontent.com/4cOIPcrRqHdX0gi3r5aM2cQTIyS9UjLVUdQi2uTeee5U9zI_lylrCS0WPeKcKgTmtplRzmQR_BvPSFX96BSE4DY11dOYT3wRWn5LUw=w600','This flamingo lives on the Island inside the Bermuda Triangle. No one ever sees the island because it is really isolated and they have unique animals also. They are Flamingos but with no wings and walking with their four legs. They are predators for small animals and sometimes they eat snakes also.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442405743621308417',0),(70,'RACIP #70','Weirdnose Camgoat','RACIP Genesis','Genesis',0,'Gray','Land','Nepal','Mammalia','Herbivore','None','Normal','Goat','Camel','None','https://lh3.googleusercontent.com/aS-znd0Jv8iE_Jg46K4zNARTLB7hUX2Ms6kPfg80uMzlHNfzS0HqX532MB-bN5X1LCJ5Jw0I8TMj5m5dJyy4Iyg6RdWVbC8BFYHgAX4=w600','This goat lives in the Himalayan Mountains in Nepal. They can go around mountains greatly and steadily. They don\'t need much water because they can drink the ice and store them on their camel\'s back. They eat plants not only leaves but branches also. They are tough animals.','https://opensea.io/assets/matic/0x2953399124f0cbb46d2cbacd8a89cf0599974963/113213206751174589015444266203969376855021728830096210240911442406843132936193',0),(71,'RACIP #71','Zebra Orang Utan','RACIP Genesis','Genesis',0,'White','Land','Antarctica','Mammalia','Omnivore','None','Normal','Orang Utan','Zebra','None','https://lh3.googleusercontent.com/9RLpC9CsNirxO9ZcwM